CB29-8: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0432\u0443\u0433\u0456\u043B\u044C\u043D\u043E\u043C\u0443 \u043F\u0430\u043B\u0438\u0432\u0456"
CB30-1: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0433\u0430\u0437\u0456"
CB31-4: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u043C\u0430\u0437\u0443\u0442\u0456"
CB32-7: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0434\u0435\u0440\u0435\u0432\u043D\u043E\u043C\u0443 \u043F\u0430\u043B\u0438\u0432\u0456"
CB33-0: "\u041E\u0434\u043D\u043E\u0444\u0430\u0437\u043D\u0438\u0439"
CB34-3: "\u0414\u0432\u043E\u0444\u0430\u0437\u043D\u0438\u0439"
CB35-6: "\u0422\u0440\u0438\u0444\u0430\u0437\u043D\u0438\u0439"
CB36-9: "\u041C\u0438\u0442\u0442\u0454\u0432\u0438\u0439; \u0448\u0432\u0438\u0434\u043A\u043E\u0433\u043E \u043F\u0440\u0438\u0433\u043E\u0442\u0443\u0432\u0430\u043D\u043D\u044F"
CB37-2: "\u041E\u0434\u043D\u043E\u0444\u0430\u0437\u043D\u0438\u0439"
CB38-5: "\u0410\u0432\u0442\u043E\u043D\u043E\u043C\u043D\u0438\u0439"
CB39-8: "\u041D\u0435\u043F\u0435\u0440\u0435\u0440\u0432\u043D\u0438\u0439"
CB40-1: "\u041F\u0435\u0440\u0435\u0440\u0432\u043D\u0438\u0439"
CB41-4: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0433\u0456\u0431\u0440\u0438\u0434\u043D\u043E\u043C\u0443 \u043F\u0430\u043B\u0438\u0432\u0456"
CB42-7: "\u0417 \u0431\u0430\u0442\u0430\u0440\u0435\u0439\u043D\u0438\u043C \u0436\u0438\u0432\u043B\u0435\u043D\u043D\u044F\u043C"
CB43-0: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0431\u0456\u043E\u0434\u0438\u0437\u0435\u043B\u044C\u043D\u043E\u043C\u0443 \u043F\u0430\u043B\u0438\u0432\u0456"
CB44-3: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0432\u0443\u0433\u043B\u0435\u0432\u043E\u0434\u043D\u0435\u0432\u043E\u043C\u0443 \u043F\u0430\u043B\u0438\u0432\u0456"
CB45-6: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0435\u0442\u0430\u043D\u043E\u043B\u043E\u0432\u043E\u043C\u0443 \u043F\u0430\u043B\u0438\u0432\u0456"
CB46-9: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0433\u0430\u0441\u0456"
CB47-2: "\u0429\u043E \u043F\u0440\u0430\u0446\u044E\u0454 \u043D\u0430 \u0433\u0430\u0437\u0456"
DA01-4: "\u041C\u0456\u0436\u043D\u0430\u0440\u043E\u0434\u043D\u0438\u0439"
DA02-7: "\u041D\u0430\u0446\u0456\u043E\u043D\u0430\u043B\u044C\u043D\u0438\u0439"
DA03-0: "\u0413\u0440\u043E\u043C\u0430\u0434\u0441\u044C\u043A\u0438\u0439; \u0434\u0435\u0440\u0436\u0430\u0432\u043D\u0438\u0439"
DA04-3: "\u041F\u0440\u0438\u0432\u0430\u0442\u043D\u0438\u0439"
DA05-6: "\u0429\u043E \u0431\u0443\u0432 \u0443 \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u0430\u043D\u043D\u0456"
DA06-9: "\u041F\u0435\u0440\u0432\u0438\u043D\u043D\u0438\u0439"
DA07-2: "\u0412\u0442\u043E\u0440\u0438\u043D\u043D\u0438\u0439"
DA08-5: "\u0422\u0440\u0435\u0442\u0438\u043D\u043D\u0438\u0439"
DA09-8: "\u0423 \u0440\u0435\u0430\u043B\u044C\u043D\u043E\u043C\u0443 \u0447\u0430\u0441\u0456"
DA10-1: "\u0421\u0442\u0430\u0434\u0456\u044F; \u0435\u0442\u0430\u043F"
DA11-4: "\u0421\u0435\u043A\u0440\u0435\u0442\u0430\u0440\u0441\u044C\u043A\u0438\u0439"
DA12-7: "\u0414\u043B\u044F \u043F\u0440\u0438\u043C\u0456\u0449\u0435\u043D\u044C"
DA13-0: "\u0414\u043B\u044F \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u0430\u043D\u043D\u044F \u043F\u043E\u0437\u0430 \u043F\u0440\u0438\u043C\u0456\u0449\u0435\u043D\u043D\u044F\u043C"
DA14-3: "\u041C\u043E\u0431\u0456\u043B\u044C\u043D\u0438\u0439; \u043F\u0435\u0440\u0435\u0441\u0443\u0432\u043D\u0438\u0439"
DA15-6: "\u041F\u043E\u0431\u0443\u0442\u043E\u0432\u0438\u0439"
DA16-9: "\u041D\u0435\u043F\u043E\u0431\u0443\u0442\u043E\u0432\u0438\u0439"
DA17-2: "\xAB\u041F\u0456\u0434 \u043A\u043B\u044E\u0447\xBB"
DA18-5: "\u041F\u0456\u0434\u0437\u0435\u043C\u043D\u0438\u0439"
DA19-8: "\u041F\u0456\u0434\u0432\u043E\u0434\u043D\u0438\u0439"
DA20-1: "\u041D\u0430 \u043C\u0456\u0441\u0446\u0456"
DA21-4: "\u041D\u0430\u0434\u0437\u0435\u043C\u043D\u0438\u0439"
DA22-7: "\u0423\u043D\u0456\u0432\u0435\u0440\u0441\u0430\u043B\u044C\u043D\u0438\u0439"
DA23-0: "\u0421\u043F\u0435\u0446\u0456\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F"
DA24-3: "\u0422\u0430 \u0441\u0443\u043F\u0443\u0442\u043D\u0456 \u0442\u043E\u0432\u0430\u0440\u0438"
DA25-6: "\u0421\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u043D\u0438\u0439; \u0437\u0432\u0438\u0447\u0430\u0439\u043D\u0438\u0439"
DA26-9: "\u041A\u0435\u0440\u0456\u0432\u043D\u0438\u0439"
DA27-2: "\u0410\u0434\u043C\u0456\u043D\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043D\u0438\u0439"
DA28-5: "\u0421\u043E\u0446\u0456\u0430\u043B\u044C\u043D\u0456 \u043F\u043E\u0441\u043B\u0443\u0433\u0438"
DA29-8: "\u0421\u043E\u0446\u0456\u0430\u043B\u044C\u043D\u0430 \u0440\u043E\u0431\u043E\u0442\u0430"
DA30-1: "\u041A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0446\u0456\u0439\u043D\u0438\u0439"
DA31-4: "\u0414\u0435\u043D\u043D\u043E\u0433\u043E \u0434\u043E\u0433\u043B\u044F\u0434\u0443"
DA32-7: "\u041F\u043B\u0430\u043D\u0443\u0432\u0430\u043D\u043D\u044F \u0441\u0456\u043C\u2019\u0457"
DA33-0: "\u0420\u0435\u0430\u0431\u0456\u043B\u0456\u0442\u0430\u0446\u0456\u0439\u043D\u0438\u0439"
DA34-3: "\u041D\u0430\u0441\u0442\u0430\u043D\u043E\u0432\u0447\u0438\u0439"
DA35-6: "\u0417 \u0440\u043E\u0431\u043E\u0447\u043E\u0433\u043E \u043F\u0440\u0438\u043C\u0456\u0449\u0435\u043D\u043D\u044F"
DA36-9: "\u041F\u0440\u0438\u0440\u043E\u0434\u043D\u0456 \u0440\u0435\u0441\u0443\u0440\u0441\u0438"
DA37-2: "\u041F\u043E\u0432\u0442\u043E\u0440\u043D\u043E\u0433\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u0430\u043D\u043D\u044F"
DA38-5: "\u0417\u043D\u0435\u0437\u0430\u0440\u0430\u0436\u0443\u0432\u0430\u043B\u044C\u043D\u0438\u0439"
DA39-8: "\u0412\u0456\u0434\u0441\u0442\u0435\u0436\u0435\u043D\u043D\u044F \u0437\u0430\u0431\u0440\u0443\u0434\u043D\u0435\u043D\u044C"
DA40-1: "\u041A\u043E\u043D\u0442\u0440\u043E\u043B\u044C \u044F\u043A\u043E\u0441\u0442\u0456"
DA41-4: "\u041E\u0431\u0440\u043E\u0431\u043A\u0430"
DA42-7: "\u0412\u043A\u043B\u044E\u0447\u043D\u043E \u0437\u0456 \u0432\u0441\u0442\u0430\u043D\u043E\u0432\u043B\u0435\u043D\u043D\u044F\u043C"
DA43-0: "\u0411\u0430\u0433\u0430\u0442\u043E\u0446\u0456\u043B\u044C\u043E\u0432\u0438\u0439"
DA44-3: "\u0417\u0430\u043F\u0430\u0441\u043D\u0456 \u0447\u0430\u0441\u0442\u0438\u043D\u0438"
EA01-5: "\u0414\u043B\u044F \u043D\u0435\u043C\u043E\u0432\u043B\u044F\u0442"
EA02-8: "\u0414\u043B\u044F \u0434\u0456\u0442\u0435\u0439; \u0434\u0438\u0442\u044F\u0447\u0438\u0439"
EA03-1: "\u0414\u043B\u044F \u043F\u0456\u0434\u043B\u0456\u0442\u043A\u0456\u0432; \u043F\u0456\u0434\u043B\u0456\u0442\u043A\u043E\u0432\u0438\u0439"
EA04-4: "\u0414\u043B\u044F \u0447\u043E\u043B\u043E\u0432\u0456\u043A\u0456\u0432; \u0447\u043E\u043B\u043E\u0432\u0456\u0447\u0438\u0439"
EA05-7: "\u0414\u043B\u044F \u043E\u0441\u0456\u0431 \u043F\u043E\u0445\u0438\u043B\u043E\u0433\u043E \u0432\u0456\u043A\u0443"
EA06-0: "\u0414\u043B\u044F \u0436\u0456\u043D\u043E\u043A; \u0436\u0456\u043D\u043E\u0447\u0438\u0439"
EA07-3: "\u0414\u043B\u044F \u0432\u0430\u0433\u0456\u0442\u043D\u0438\u0445"
EA08-6: "\u0414\u043B\u044F \u0431\u0435\u0437\u0440\u043E\u0431\u0456\u0442\u043D\u0438\u0445"
EA09-9: "\u0414\u043B\u044F \u0431\u0435\u0437\u043F\u0440\u0438\u0442\u0443\u043B\u044C\u043D\u0438\u0445"
EA10-2: "\u0414\u043B\u044F \u043E\u0441\u0456\u0431, \u0449\u043E \u0432\u0436\u0438\u0432\u0430\u044E\u0442\u044C \u043D\u0430\u0440\u043A\u043E\u0442\u0438\u043A\u0438"
EA11-5: "\u0414\u043B\u044F \u043F\u0435\u043D\u0441\u0456\u043E\u043D\u0435\u0440\u0456\u0432"
EA12-8: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u0456\u043D\u0432\u0430\u043B\u0456\u0434\u0456\u0432"
EA13-1: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u043E\u0441\u0456\u0431 \u0456\u0437 \u0444\u0456\u0437\u0438\u0447\u043D\u0438\u043C\u0438 \u0432\u0430\u0434\u0430\u043C\u0438"
EA14-4: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u043F\u0430\u0440\u0430\u043B\u0456\u0437\u043E\u0432\u0430\u043D\u0438\u0445"
EA15-7: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u043E\u0441\u0456\u0431 \u0437 \u043E\u0434\u043D\u043E\u0441\u0442\u043E\u0440\u043E\u043D\u043D\u0456\u043C \u043F\u0430\u0440\u0430\u043B\u0456\u0447\u0435\u043C"
EA16-0: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u043E\u0441\u0456\u0431 \u0437 \u0442\u0435\u0442\u0440\u0430\u043F\u043B\u0435\u0433\u0456\u0454\u044E"
EA17-3: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u043E\u0441\u0456\u0431 \u0437 \u043F\u0430\u0440\u0430\u043B\u0456\u0447\u0435\u043C \u043D\u0438\u0436\u043D\u0456\u0445 \u043A\u0456\u043D\u0446\u0456\u0432\u043E\u043A"
EA18-6: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u043D\u0456\u043C\u0438\u0445"
EA19-9: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u043E\u0441\u0456\u0431 \u0456\u0437 \u0432\u0430\u0434\u0430\u043C\u0438 \u0441\u043B\u0443\u0445\u0443"
EA20-2: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u0433\u043B\u0443\u0445\u043E\u043D\u0456\u043C\u0438\u0445"
EA21-5: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u043E\u0441\u0456\u0431 \u0456\u0437 \u0432\u0430\u0434\u0430\u043C\u0438 \u0437\u043E\u0440\u0443"
EA22-8: "\u0414\u043B\u044F / \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u043E \u0434\u043B\u044F \u043E\u0441\u0456\u0431 \u0456\u0437 \u043F\u0441\u0438\u0445\u0456\u0447\u043D\u0438\u043C\u0438 \u0437\u0430\u0445\u0432\u043E\u0440\u044E\u0432\u0430\u043D\u043D\u044F\u043C\u0438"
EA23-1: "\u041F\u0430\u0441\u0430\u0436\u0438\u0440\u0441\u044C\u043A\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F / \u0434\u043B\u044F \u043F\u0430\u0441\u0430\u0436\u0438\u0440\u0456\u0432"
EA24-4: "\u0414\u043B\u044F \u043E\u0431\u043C\u0435\u0436\u0435\u043D\u043E\u0433\u043E \u043A\u043E\u043B\u0430 \u043A\u043B\u0456\u0454\u043D\u0442\u0456\u0432"
EA25-7: "\u0414\u043B\u044F \u0443\u0432\u2019\u044F\u0437\u043D\u0435\u043D\u0438\u0445"
EA26-0: "\u0414\u043B\u044F \u043F\u0430\u0446\u0456\u0454\u043D\u0442\u0456\u0432"
EA27-3: "\u0414\u043B\u044F \u043F\u0430\u0446\u0456\u0454\u043D\u0442\u0456\u0432, \u044F\u043A\u0456 \u043D\u0435 \u043F\u043E\u0442\u0440\u0435\u0431\u0443\u044E\u0442\u044C \u043D\u0435\u0432\u0456\u0434\u043A\u043B\u0430\u0434\u043D\u043E\u0457 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0438"
EA28-6: "\u0414\u043B\u044F \u0440\u0435\u0433\u0443\u043B\u044F\u0440\u043D\u0438\u0445 \u043F\u0430\u0441\u0430\u0436\u0438\u0440\u0441\u044C\u043A\u0438\u0445 \u043F\u0435\u0440\u0435\u0432\u0435\u0437\u0435\u043D\u044C"
EA29-9: "\u0414\u043B\u044F \u0437\u0430\u0441\u0442\u043E\u0441\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u043B\u044E\u0434\u0438\u043D\u043E\u044E"
EA30-2: "\u0414\u043B\u044F \u0442\u0432\u0430\u0440\u0438\u043D"
FA01-6: "\u041E\u0441\u0432\u0456\u0442\u043D\u044C\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F"
FA02-9: "\u0414\u043B\u044F \u0434\u0438\u0442\u044F\u0447\u0438\u0445 \u0441\u0430\u0434\u043A\u0456\u0432"
FA03-2: "\u0414\u043B\u044F \u0448\u043A\u0456\u043B"
