MA08-5: "\u0414\u043B\u044F \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
MA09-8: "\u0414\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443\u0432\u0430\u043D\u043D\u044F"
MA10-1: "\u0414\u043B\u044F \u0437\u0430\u0441\u0442\u043E\u0441\u0443\u0432\u0430\u043D\u043D\u044F \u0432 \u0430\u0435\u0440\u043E\u043F\u043E\u0440\u0442\u0430\u0445"
MA11-4: "\u0414\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u0438\u0445 \u0437\u0430\u0441\u043E\u0431\u0456\u0432"
MA12-7: "\u0414\u043B\u044F \u043C\u0456\u0441\u044C\u043A\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
MA13-0: "\u0414\u043B\u044F \u0432\u043E\u0434\u043D\u0438\u0445 \u0448\u043B\u044F\u0445\u0456\u0432"
MA14-3: "\u0414\u043B\u044F \u0447\u043E\u0432\u043D\u0456\u0432"
MB01-5: "3 \u043B\u0456\u0432\u043E\u0441\u0442\u043E\u0440\u043E\u043D\u043D\u0456\u043C \u043A\u0435\u0440\u0443\u0432\u0430\u043D\u043D\u044F\u043C"
MB02-8: "3 \u043F\u0440\u0430\u0432\u043E\u0441\u0442\u043E\u0440\u043E\u043D\u043D\u0456\u043C \u043A\u0435\u0440\u0443\u0432\u0430\u043D\u043D\u044F\u043C"
