MD01-7: "\u0417 \u0440\u0435\u0444\u0440\u0438\u0436\u0435\u0440\u0430\u0442\u043E\u0440\u0430\u043C\u0438"
MD02-0: "\u0417 \u0430\u0432\u0442\u043E\u0446\u0438\u0441\u0442\u0435\u0440\u043D\u0430\u043C\u0438"
MD03-3: "\u0417 \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u0438\u043C \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043E\u043C, \u0430\u0434\u0430\u043F\u0442\u043E\u0432\u0430\u043D\u0438\u043C \u0434\u043B\u044F \u043D\u0430\u043A\u0438\u0434\u043D\u0438\u0445 \u0432\u0430\u043D\u0442\u0430\u0436\u0456\u0432"
MD04-6: "\u0417 \u043A\u043E\u043D\u0442\u0435\u0439\u043D\u0435\u0440\u043E\u0432\u043E\u0437\u0430\u043C\u0438"
MD05-9: "\u0417 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u0438\u043C\u0438 \u0437\u0430\u0441\u043E\u0431\u0430\u043C\u0438 \u0434\u043B\u044F \u043F\u0435\u0440\u0435\u0432\u0435\u0437\u0435\u043D\u043D\u044F \u043C\u0435\u0431\u043B\u0456\u0432"
MD06-2: "\u0417 \u0432\u0430\u043D\u0442\u0430\u0436\u043D\u0438\u043C\u0438 \u043F\u0440\u0438\u0447\u0435\u043F\u0430\u043C\u0438"
MD07-5: "\u0417 \u0431\u0440\u043E\u043D\u044C\u043E\u0432\u0430\u043D\u0438\u043C\u0438 \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044F\u043C\u0438"
ME01-8: "\u0421\u0443\u0445\u043E\u0457 \u043D\u0430\u0441\u0438\u043F\u043D\u043E\u0457 \u043F\u0440\u043E\u0434\u0443\u043A\u0446\u0456\u0457"
ME02-1: "\u041F\u0440\u0438\u0440\u043E\u0434\u043D\u043E\u0433\u043E \u0433\u0430\u0437\u0443"
