QA04-7: "\u0414\u043B\u044F \u0406\u043D\u0442\u0435\u0440\u043D\u0435\u0442-\u0440\u0435\u043A\u043B\u0430\u043C\u0438"
QA05-0: "\u0414\u043B\u044F \u0440\u0435\u043A\u043B\u0430\u043C\u0443\u0432\u0430\u043D\u043D\u044F \u0432 \u043A\u0456\u043D\u043E\u0442\u0435\u0430\u0442\u0440\u0430\u0445"
QA06-3: "\u0414\u043B\u044F \u0440\u0435\u043A\u043B\u0430\u043C\u0443\u0432\u0430\u043D\u043D\u044F \u0432 \u0433\u0430\u0437\u0435\u0442\u0430\u0445"
QA07-6: "\u0414\u043B\u044F \u0440\u0435\u043A\u043B\u0430\u043C\u0443\u0432\u0430\u043D\u043D\u044F \u0432 \u0436\u0443\u0440\u043D\u0430\u043B\u0430\u0445"
QA08-9: "\u0414\u043B\u044F \u0440\u0435\u043A\u043B\u0430\u043C\u0443\u0432\u0430\u043D\u043D\u044F \u0437\u0430 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u043E\u044E \u043F\u043E\u0441\u0442\u0435\u0440\u0456\u0432"
QA09-2: "\u0414\u043B\u044F \u0440\u0435\u043A\u043B\u0430\u043C\u0443\u0432\u0430\u043D\u043D\u044F \u0437\u0430 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u043E\u044E \u043A\u0443\u043F\u043E\u043D\u0456\u0432"
QA10-5: "\u0414\u043B\u044F \u044F\u0440\u043C\u0430\u0440\u043E\u043A"
QA11-8: "\u0414\u043B\u044F \u0437\u0430\u0445\u043E\u0434\u0456\u0432"
