QB01-9: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0434\u043E\u0433\u043E\u0432\u0456\u0440\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB02-2: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0442\u043E\u0440\u0433\u043E\u0432\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB03-5: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u043A\u043E\u0440\u043F\u043E\u0440\u0430\u0442\u0438\u0432\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB04-8: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430 \u043F\u0440\u043E \u0437\u0430\u0445\u0438\u0441\u0442 \u043A\u043E\u043D\u043A\u0443\u0440\u0435\u043D\u0446\u0456\u0457"
QB05-1: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0430\u0434\u043C\u0456\u043D\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB06-4: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u043F\u0440\u0438\u0432\u0430\u0442\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB07-7: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u043F\u0443\u0431\u043B\u0456\u0447\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB08-0: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u043C\u0456\u0436\u043D\u0430\u0440\u043E\u0434\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB09-3: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u043D\u0430\u0446\u0456\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430"
QB10-6: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0440\u0435\u0433\u0456\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430"
QB11-9: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0442\u0440\u0443\u0434\u043E\u0432\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB12-2: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0456\u043C\u043C\u0456\u0433\u0440\u0430\u0446\u0456\u0439\u043D\u043E\u0433\u043E \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430"
QB13-5: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u043F\u043E\u0434\u0430\u0442\u043A\u043E\u0432\u043E\u0433\u043E \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430"
QB14-8: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0441\u043E\u0446\u0456\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430"
QB15-1: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u043A\u0440\u0438\u043C\u0456\u043D\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB16-4: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430 \u043F\u0440\u043E \u0437\u0430\u0445\u0438\u0441\u0442 \u0432\u0456\u0434 \u0434\u0438\u0441\u043A\u0440\u0438\u043C\u0456\u043D\u0430\u0446\u0456\u0457 \u0430\u0431\u043E \u0434\u043E\u043C\u0430\u0433\u0430\u043D\u044C"
QB17-7: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430 \u0443 \u0441\u043F\u0440\u0430\u0432\u0430\u0445 \u043D\u0435\u043F\u043E\u0432\u043D\u043E\u043B\u0456\u0442\u043D\u0456\u0445"
QB18-0: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u043F\u0440\u043E\u0446\u0435\u0434\u0443\u0440\u0438 \u0430\u043F\u0435\u043B\u044F\u0446\u0456\u0457"
QB19-3: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430 \u0443 \u0441\u0444\u0435\u0440\u0456 \u043E\u0431\u043E\u0440\u043E\u043D\u0438"
QB20-6: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB21-9: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0434\u0435\u0440\u0436\u0430\u0432\u043D\u043E\u0433\u043E \u0430\u043D\u0442\u0438\u043C\u043E\u043D\u043E\u043F\u043E\u043B\u044C\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB23-5: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430 \u0443 \u0441\u0444\u0435\u0440\u0456 \u0431\u0430\u043D\u043A\u0440\u0443\u0442\u0441\u0442\u0432\u0430"
QB24-8: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430 \u043F\u0440\u043E \u0442\u043E\u0432\u0430\u0440\u0438\u0441\u0442\u0432\u0430"
QB25-1: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u043F\u0430\u0442\u0435\u043D\u0442\u043D\u043E\u0433\u043E \u043F\u0440\u0430\u0432\u0430"
QB26-4: "\u0417 \u043F\u0438\u0442\u0430\u043D\u044C \u0437\u0430\u043A\u043E\u043D\u043E\u0434\u0430\u0432\u0441\u0442\u0432\u0430 \u043F\u0440\u043E \u0437\u0430\u0445\u0438\u0441\u0442 \u043F\u0440\u0430\u0432 \u043D\u0430 \u0442\u043E\u0440\u0433\u043E\u0432\u0435\u043B\u044C\u043D\u0456 \u043C\u0430\u0440\u043A\u0438"
